RESPONSE=$RESPONSE1$RESPONSE2

#echo "$RESPONSE" | jq .[0] > sss.txt
echo "payments:" >> $OUTPUT_FNAME

for (( N=1; N<=$PAYMENT_COUNT; N++ )) {
    PAYMENT_ID=${N}
    BOOK_ID=""
    BOOK_NUMBER=$(( N*5+1 ))
    DEBT_ID=${N}

    FIRSTNAME=$(echo "$RESPONSE"  | jq '.['$N'] .firstname' )
    LASTNAME=$(echo "$RESPONSE"  | jq '.['$N'] .lastname' )
    BANK_ACCOUNT=$(echo "$RESPONSE"  | jq '.['$N'] .bankAccount' )
    OTHER_INFO=''

    PAYMENT_AMOUNT="\"EUR $(shuf -i10-79 -n1).$(shuf -i0-9 -n1)$(shuf -i0-9 -n1)\""
    PAYMENT_TRANSACTION_NUMBER=\"$(cat /dev/urandom | tr -dc 'a-zA-Z0-9' | fold -w 17 | head -n 1)\"
    PAYMENT_INFO="\"${PAYMENT_LATE_REASONS[$(shuf -i1-10 -n1)]}\""
    PAYMENT_RECEIPT_PHOTO=''

#   Book_data saving to file...
    echo "  - paymentId: $PAYMENT_ID" >> $OUTPUT_FNAME
    echo "    bookId: $BOOK_ID" >> $OUTPUT_FNAME
    echo "    bookNumber: $BOOK_NUMBER" >> $OUTPUT_FNAME
    echo "    debtId: $DEBT_ID" >> $OUTPUT_FNAME

    echo "    firstname: $FIRSTNAME" >> $OUTPUT_FNAME
    echo "    lastname: $LASTNAME" >> $OUTPUT_FNAME
    echo "    bankAccount: $BANK_ACCOUNT" >> $OUTPUT_FNAME
    echo "    otherInfo: $OTHER_INFO" >> $OUTPUT_FNAME

    echo "    amount: $PAYMENT_AMOUNT" >> $OUTPUT_FNAME
    echo "    transactionNumber: $PAYMENT_TRANSACTION_NUMBER" >> $OUTPUT_FNAME
    echo "    paymentInfo: $PAYMENT_INFO" >> $OUTPUT_FNAME
    echo "    paymentReceiptPhoto: $PAYMENT_RECEIPT_PHOTO" >> $OUTPUT_FNAME
}